<div class="header"><?php include("header.php"); ?></div><h1>OpenSubtitles v2024</h1><p>This is a new collection of translated movie subtitles from <a href="http://www.opensubtitles.org/">http://www.opensubtitles.org/</a>.<br/><a href="http://www.opensubtitles.org/"><img src="https://static.opensubtitles.org/gfx/logo.gif"></a></p><p><b>IMPORTANT:</b> If you use the OpenSubtitle corpus: Please, add a link to <b>http://www.opensubtitles.org/</b> to your website and to your reports and publications produced with the data! I promised this when I got the data from the providers of that website!</p> <p> This is a slightly cleaner version of the subtitle collection using improved sentence alignment and better language checking.</p><p>93 languages, 3,377 bitexts<br>total number of files: 7,707,669<br>total number of tokens: 41.03G<br>total number of sentence fragments: 5.33G<br><p>Please cite the following article if you use any part of the corpus in your own work:<br/> P. Lison and J. Tiedemann, 2016, <a href="http://stp.lingfil.uu.se/~joerg/paper/opensubs2016.pdf"><i>OpenSubtitles2016: Extracting Large Parallel Corpora from Movie and TV Subtitles.</i></a> In Proceedings of the 10th International Conference on Language Resources and Evaluation (LREC 2016)<br/><h3>Download</h3><p>Below you can download data files for all language pairs in different formats and with different kind of annotation (if available). You can click on the various links as explained below. In addition to the files shown on this webpage, OPUS also provides pre-compiled word alignments and phrase tables, bilingual dictionaries, frequency counts, and these files can be found through the <a href="/index.php">resources search form on the top-level website of OPUS</a>.</p><p></p><p>We also provide <b>sentence alignments between alternative subtitle uploads</b>. This produces a lot of repeated material and, therefore, we do not provide data sets that are compiled into plain text or TMX format. Instead, you can download the standoff annotation of the sentence alignment from the <a href="/index.php">form at the top-level website</a>. There are links to [alt] in the "other files" column of the search result if they exist.</p><p>OpenSubtitles also includes <b>intra-lingual sentence alignments</b> between alternative subtitle uploads in the same language. To access those files, <a href="OpenSubtitles-alt-v2024.php">look at this website</a> or search for resources with the same source and target language using the form on the <a href="/index.php">top-level website</a>. The intra-lingual links are divided into different categories (listed in the column "other files" in the search result):</p> <ul> <li><b>insert:</b> Sentence pairs that differ only by some inserted text on one side</li> <li><b>other:</b> Other types of sentence pairs; probably paraphrases and/or stylistically different subtitles.</li> <li><b>pct:</b> Sentence pairs that differ only in punctuation characters.</li> <li><b>spell:</b> Sentence pairs that differ in a few characters only that looks suspiciously like misspellings.</li> </ul> <p>For more information, please look at <br/> J. Tiedemann, 2016, <a href="http://stp.lingfil.uu.se/~joerg/paper/lrec2016.pdf"><i>Finding Alternative Translations in a Large Corpus of Movie Subtitles.</i></a><br/> In Proceedings of the 10th International Conference on Language Resources and Evaluation (LREC 2016)<br/>(and, please, cite the paper as well).</p><h3>Release history:</h3><p><ul><li><a href="OpenSubtitles-v1.php">OpenSubtitles v1</a></li> <li><a href="OpenSubtitles-v2011.php">OpenSubtitles v2011</a></li> <li><a href="OpenSubtitles-v2012.php">OpenSubtitles v2012</a></li> <li><a href="OpenSubtitles-v2013.php">OpenSubtitles v2013</a></li> <li><a href="OpenSubtitles-v2016.php">OpenSubtitles v2016</a></li> <li><a href="OpenSubtitles-v2018.php">OpenSubtitles v2018</a></li> <li><a href="OpenSubtitles-v2024.php">OpenSubtitles v2024</a></li></ul></p><table><tr><td>Bottom-left 